import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';

function Navigation() {
  return (
    <Router>
      <nav>
        <div className="logo">
          <span className="brand-name">Gling</span>
          <span className="brand-desc">Urban Bikes</span>
        </div>
        <ul className="nav-links">
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/">Home</Link>
          </li>
        </ul>
      </nav>
    </Router>
  );
}

function Header() {
  return (
    <header>
      <Navigation />
    </header>
  );
}
export default Header;
